// ==UserScript==
// @name         Nurple
// @namespace    http://tampermonkey.net/
// @version      3.14
// @description  Spawns a nurple
// @author       Tanks
// @match        *://*/*
// @grant        none
// @downloadURL https://update.greasyfork.org/scripts/550559/Nurple.user.js
// @updateURL https://update.greasyfork.org/scripts/550559/Nurple.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const GIF_BASE64 = "data:image/gif;base64,";
    const GIF_SIZE = 150.5;
    const GRAVITY = 0.5;
    const BOUNCE = 0.7;
    const FRICTION = 0.99;
    const SPAWN_OFFSET = 20;
    const TOP_OFFSET = -95;
    let gifs = [];

    function createGif(x, y) {
        const gif = document.createElement('img');
        gif.src = GIF_BASE64;
        gif.style.cssText = `
            position: fixed;
            width: ${GIF_SIZE}px;
            height: auto;
            z-index: 999999;
            cursor: move;
            left: ${x}px;
            top: ${y}px;
            user-select: none;
            touch-action: none;
        `;

        gif.vx = 0;
        gif.vy = 0;
        gif.isDragging = false;

        gif.dragOffset = { x: 0, y: 0 };
        gif.lastPos = { x: 0, y: 0 };
        gif.lastTime = 0;

        document.body.appendChild(gif);
        gifs.push(gif);

        gif.addEventListener('mousedown', startDrag);
        gif.addEventListener('touchstart', startDrag, { passive: false });
        gif.addEventListener('dblclick', removeGif);

        return gif;
    }

    function spawnGif() {
        const x = window.innerWidth - GIF_SIZE - SPAWN_OFFSET;
        const y = window.innerHeight - GIF_SIZE - SPAWN_OFFSET + TOP_OFFSET;
        return createGif(x, y);
    }
    function dropGif() {
        const x = Math.random() * (window.innerWidth - GIF_SIZE);
        return createGif(x, 0);
    }
    function getPosition(e) {
        if (e.touches) {
            return { x: e.touches[0].clientX, y: e.touches[0].clientY };
        }
        return { x: e.clientX, y: e.clientY };
    }
    function startDrag(e) {
        const gif = e.target;
        gif.isDragging = true;
        const pos = getPosition(e);
        gif.dragOffset.x = pos.x - gif.offsetLeft;
        gif.dragOffset.y = pos.y - gif.offsetTop;
        gif.lastPos.x = pos.x;
        gif.lastPos.y = pos.y;
        gif.lastTime = Date.now();
        document.addEventListener('mousemove', drag);
        document.addEventListener('touchmove', drag, { passive: false });
        document.addEventListener('mouseup', endDrag);
        document.addEventListener('touchend', endDrag);

        e.preventDefault();
    }

    function drag(e) {
        const gif = gifs.find(g => g.isDragging);
        if (!gif) return;

        const pos = getPosition(e);

        const now = Date.now();
        const timeDiff = now - gif.lastTime;

        if (timeDiff > 0) {
            gif.vx = (pos.x - gif.lastPos.x) / timeDiff * 10;
            gif.vy = (pos.y - gif.lastPos.y) / timeDiff * 10;
        }

        gif.style.left = (pos.x - gif.dragOffset.x) + 'px';
        gif.style.top = (pos.y - gif.dragOffset.y) + 'px';
        gif.lastPos.x = pos.x;
        gif.lastPos.y = pos.y;
        gif.lastTime = now;

        e.preventDefault();
    }

    function endDrag() {
        const gif = gifs.find(g => g.isDragging);
        if (gif) gif.isDragging = false;

        document.removeEventListener('mousemove', drag);
        document.removeEventListener('touchmove', drag);
        document.removeEventListener('mouseup', endDrag);
        document.removeEventListener('touchend', endDrag);
    }

    function removeGif(e) {
        const gif = e.target;
        const index = gifs.indexOf(gif);
        if (index > -1) gifs.splice(index, 1);
        gif.remove();
    }

    function updatePhysics() {
        gifs.forEach(gif => {
            if (gif.isDragging) return;

            gif.vy += GRAVITY;
            gif.vx *= FRICTION;

            let x = gif.offsetLeft + gif.vx;
            let y = gif.offsetTop + gif.vy;

            if (x < 0) {
                x = 0;
                gif.vx = -gif.vx * BOUNCE;
            } else if (x + gif.offsetWidth > window.innerWidth) {
                x = window.innerWidth - gif.offsetWidth;
                gif.vx = -gif.vx * BOUNCE;
            }

            if (y < 0) {
                y = 0;
                gif.vy = -gif.vy * BOUNCE;
                if (Math.abs(gif.vy) < 1) gif.vy = 0;
            } else if (y + gif.offsetHeight > window.innerHeight) {
                y = window.innerHeight - gif.offsetHeight;
                gif.vy = -gif.vy * BOUNCE;
                if (Math.abs(gif.vy) < 1) gif.vy = 0;
            }

            gif.style.left = x + 'px';
            gif.style.top = y + 'px';
        });

        requestAnimationFrame(updatePhysics);
    }

    document.addEventListener('keydown', e => {
        if (e.ctrlKey && e.key === 'y') {
            e.preventDefault();
            dropGif();
        }
    });

    spawnGif();
    updatePhysics();
})();